import React from "react";
import styled from "styled-components";
import { PortfolioCard } from "../share-components/Cards/PortfolioCard";
import { CardTitle } from "../share-components/Cards/CardTitle";

function Portfolio(){
    return(
        <Wrapper>
            <CardTitle>Web apptet</CardTitle>

            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
            </CardContainer>
        </Wrapper>
    )
}

export {Portfolio}

const Wrapper = styled.div`
height: 100%;
width: 100%;
display:flex;
flex-direction:row;
`;

const CardContainer = styled.div`
display:flex;
flex-direction:row;
height:100%;
width:100%;
`;
